import React from "react";
import "./TodoItem.css";

const deletIcon = (
  <svg
    width="24"
    height="24"
    viewBox="0 0 24 24"
    fill="none"
    xmlns="http://www.w3.org/2000/svg"
  >
    <g clip-path="url(#clip0_2_32)">
      <path
        d="M0 19C0 20.1 0.9 21 2 21H10C11.1 21 12 20.1 12 19V7H0V19ZM13 4H9.5L8.5 3H3.5L2.5 4H-1V6H13V4Z"
        fill="black"
      />
    </g>
    <defs>
      <clipPath id="clip0_2_32">
        <rect width="24" height="24" fill="white" />
      </clipPath>
    </defs>
  </svg>
);

const editIcon = (<img src='../../assets/icons/material-symbols_edit-rounded.png'></img>);

function TodoItem() {
  return (
    <div className="TodoItem">

      <label>Task</label>
      <div className="icons">
        <div>{deletIcon}</div>
        <div>{editIcon}</div>
      </div>
    </div>
  );
}

export default TodoItem;
